appointment:
"Обеспечение:
1) возможности сбора информации о выполнении государственных программ Хабаровского края утвержденных нормативно-правовыми актами Губернатора и Правительства Хабаровского края  (государственных программ)  в электронном виде;
2) оценки эффективности реализации государственных программ; 
3) отслеживания зависимостей между различными государственными программами;
4) контроля исполнения государственных программ; 
5) повышения эффективности выполнения государственных программ."
